import './Profile.css';
import Header from '../Header/Header';

export default function Orders({ orders }) {

  console.log(orders)
  if (!orders) {
    return <div>Loading...</div>
  }


  return (
    <>
    <Header/>
    <main className='orders'>
      <ul className='orders-list'>
        <h1>Заказы</h1>
        {orders.map((order) => (
          <li className='order'>
            <h3 className='order__header'>Заказ от {order.createdAt} на {order.totalPrice} &#8381;</h3>
          
            <p className='order__number'>№{order.orderId}</p>
            <p className='order__status'>{order.orderStatus}</p>
    
          </li>
        ))}
      </ul>
    </main>
    </>
  )
}
